import React from "react";
import { Link } from "react-router-dom";
import backgroundImage from "../bg.jpg";

const Home = () => {
  const styles = {
    container: {
      backgroundImage: `url(${backgroundImage})`,
      backgroundSize: "cover",
      backgroundPosition: "center",
      minHeight: "100vh",
      display: "flex",
      flexDirection: "column",
      alignItems: "center",
      justifyContent: "center",
      padding: "20px",
    },
    title: {
      marginBottom: "10px",
      color: "black",
      textAlign: "center",
      marginTop: "40px", // Ubah nilai marginTop sesuai preferensi Anda
    },
    button: {
      color: "white",
      marginTop: "10px", // Ubah nilai marginTop sesuai preferensi Anda
    },
  };

  return (
    <div style={styles.container}>
      <h2 style={styles.title}>Home</h2>
      <div style={styles.button}>
        <button data-testid="student-btn">
          <Link to="/student">Djarot Purnomo</Link>
        </button>
      </div>
    </div>
  );
};

export default Home;
